import { Link } from "react-router-dom";

const ProductsPage = () => {
  return (
    <>
      <h1>The Products Page</h1>
      <ul>
        <li>
            <Link to="/products/product-1">Product 1</Link>
        </li>
        <li to="/products/product-1">
          <Link>Product 2</Link>
        </li>
        <li to="/products/product-1">
          <Link>Product 3</Link>
        </li>
      </ul>
    </>
  );
};

export default ProductsPage;
